import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [rankedPrefs, setRankedPrefs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("http://localhost:5000/api/users", {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
    })
      .then((res) => res.json())
      .then((users) => {
        const counts = {};
        users.forEach((user) => {
          if (user.preferences && user.preferences.length) {
            user.preferences.forEach((pref) => {
              counts[pref] = (counts[pref] || 0) + 1;
            });
          }
        });

        const ranked = Object.entries(counts)
          .map(([pref, count]) => ({ preference: pref, count }))
          .sort((a, b) => b.count - a.count);

        setRankedPrefs(ranked);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching users:", err);
        setLoading(false);
      });
  }, []);

  return (
    <div
      style={{
        marginLeft: 220,
        padding: 30,
        fontFamily: "'Poppins', sans-serif",
        background: "linear-gradient(180deg, #f4faf4 0%, #ffffff 100%)",
        minHeight: "100vh",
        color: "#2f3e2f",
        transition: "all 0.3s ease",
      }}
    >
      <h2
        style={{
          fontSize: "2rem",
          color: "#2b593f",
          marginBottom: "25px",
          textShadow: "1px 1px 2px rgba(43, 89, 63, 0.2)",
          fontWeight: 700,
        }}
      >
        Most Common Preferences
      </h2>

      {loading ? (
        <p style={{ color: "#6b8061", fontStyle: "italic", fontSize: "1.1rem" }}>
          Loading...
        </p>
      ) : rankedPrefs.length === 0 ? (
        <p style={{ color: "#6b8061", fontStyle: "italic", fontSize: "1.1rem" }}>
          No preferences found.
        </p>
      ) : (
        <div
          style={{
            backgroundColor: "#ffffff",
            borderRadius: "16px",
            boxShadow: "0 6px 20px rgba(50, 100, 70, 0.1)",
            width: "80%",
            overflow: "hidden",
            transition: "transform 0.3s ease",
          }}
          onMouseEnter={(e) => (e.currentTarget.style.transform = "translateY(-3px)")}
          onMouseLeave={(e) => (e.currentTarget.style.transform = "translateY(0)")}
        >
          <table
            style={{
              width: "100%",
              borderCollapse: "collapse",
              borderRadius: "12px",
              overflow: "hidden",
              fontSize: "1.1rem",
            }}
          >
            <thead>
              <tr style={{ backgroundColor: "#7ebc85", color: "#fff" }}>
                <th
                  style={{
                    border: "none",
                    padding: "16px",
                    textAlign: "left",
                    fontWeight: "600",
                    letterSpacing: "0.5px",
                  }}
                >
                  Rank
                </th>
                <th
                  style={{
                    border: "none",
                    padding: "16px",
                    textAlign: "left",
                    fontWeight: "600",
                    letterSpacing: "0.5px",
                  }}
                >
                  Preference
                </th>
                <th
                  style={{
                    border: "none",
                    padding: "16px",
                    textAlign: "left",
                    fontWeight: "600",
                    letterSpacing: "0.5px",
                  }}
                >
                  Count
                </th>
              </tr>
            </thead>
            <tbody>
              {rankedPrefs.map((item, index) => (
                <tr
                  key={item.preference}
                  style={{
                    backgroundColor: index % 2 === 0 ? "#f3f8f3" : "#ffffff",
                    transition: "background-color 0.3s ease",
                  }}
                  onMouseEnter={(e) =>
                    (e.currentTarget.style.backgroundColor = "#e8f3e8")
                  }
                  onMouseLeave={(e) =>
                    (e.currentTarget.style.backgroundColor =
                      index % 2 === 0 ? "#f3f8f3" : "#ffffff")
                  }
                >
                  <td
                    style={{
                      borderBottom: "1px solid #d9e4d6",
                      padding: "14px 16px",
                      color: "#2f3e2f",
                      fontWeight: "600",
                    }}
                  >
                    {index + 1}
                  </td>
                  <td
                    style={{
                      borderBottom: "1px solid #d9e4d6",
                      padding: "14px 16px",
                      color: "#345c34",
                    }}
                  >
                    {item.preference}
                  </td>
                  <td
                    style={{
                      borderBottom: "1px solid #d9e4d6",
                      padding: "14px 16px",
                      color: "#4b7d4b",
                      fontWeight: "500",
                    }}
                  >
                    {item.count}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
